    //         return res.json();
    //     })
    //     .then((data) => {
    //         console.log(data);
    //         setDatas(data);
    //     });
    // }, []);

    useEffect(() => {
        const fetchData = async () => {
          const response = await fetch("http://localhost:8000");
          const newData = await response.json();
          setDatas(newData);
        };
    
        fetchData();
      }, []);

    let someId = Math.floor(Math.random() * 11);
    return(
        <main className="mainSection">
            <article className="mainArticle">
                <Link to={`/recipes/${someId}`}>
                   <h1>Kolaci neki</h1>
                </Link>
                <div className="mainWallpaper">Slika</div>
                <p>Autor: Dusan</p>
            </article>
       </main>
    );
};

export default Homepage;
